  src: url("./assets/fonts/CoreGTE1.otf");
}

@font-face {
  font-family: CoreGTE2;
  src: url("./assets/fonts/CoreGTE2.otf");
}

@font-face {
  font-family: CoreGTE3;
  src: url("./assets/fonts/CoreGTE3.otf");
}

@font-face {
  font-family: CoreGTE4;
  src: url("./assets/fonts/CoreGTE4.otf");
