}
@font-face {
  font-family: CoreGTE8;
  src: url("./assets/fonts/CoreGTE8.otf");
}
@font-face {
  font-family: CoreGTE9;
  src: url("./assets/fonts/CoreGTE9.otf");
}

    ${reset};
    a{
        text-decoration:none;
        color:inherit;
    }
